INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 1, 10040, 24001, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "あたしだって\nやるときはやるよ！", "2030/12/17 14:59:59", 0, "リン", 1);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 1, 10040, 24002, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2030/12/17 14:59:59", 1, "リン", 1);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 1, 10040, 24003, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", "2030/12/17 14:59:59", 2, "リン", 1);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 2, 10040, 24004, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "やったね！\nこれでようやく\nサボれるよ…", "2030/12/17 14:59:59", 3, "リン", 2);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 1, 10040, 24005, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2030/12/17 14:59:59", 4, "リン", 1);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 2, 10040, 24006, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2030/12/17 14:59:59", 5, "リン", 2);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 2, 10040, 24007, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "あたしも意外と\nやるもんでしょ？", "2030/12/17 14:59:59", 6, "リン", 2);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 4, 10040, 24008, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2030/12/17 14:59:59", 7, "リン", 4);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 4, 10040, 24009, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2030/12/17 14:59:59", 8, "リン", 4);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 4, 10040, 24010, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", "2030/12/17 14:59:59", 9, "リン", 4);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 4, 10040, 24011, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "やられた…\nねずみって意外と\nてごわいね", "2030/12/17 14:59:59", 10, "リン", 4);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 4, 10040, 24012, 0.0, "2020/04/30 12:00:00", 0.0, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2030/12/17 14:59:59", 11, "リン", 4);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (102601, 24, 1, 10040, 24013, 0.0, "2020/04/30 12:00:00", 1.81, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", "2030/12/17 14:59:59", 12, "リン", 4);
